package org.springframework.samples.petclinic.owner;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;

class PetTest {

	private Pet instance;

	@BeforeEach
	void setUp() {
		instance = new Pet();
	}

	@Test
	@DisplayName("Verifies that setting a valid birth date using setBirthDate stores the value, confirmed by retrieving it with getBirthDate")
	void testSetBirthDateWithValidDate() {
		instance.setBirthDate(LocalDate.of(2020, 5, 15));
	}

	@Test
	@DisplayName("Verifies that setting birth date to null updates the field, confirmed by retrieving null with getBirthDate")
	void testSetBirthDateWithNull() {
		instance.setBirthDate(null);
	}

	@Test
	@DisplayName("Verifies that getBirthDate returns the LocalDate object that was set")
	void testGetBirthDateReturnsSetDate() {
		instance.setBirthDate(LocalDate.of(2020, 5, 15));
		var result = instance.getBirthDate();
		assertEquals(LocalDate.of(2020, 5, 15), result);
	}

	@Test
	@DisplayName("Verifies that getBirthDate returns null if the birthDate field has not been set")
	void testGetBirthDateReturnsNullIfNotSet() {
		var result = instance.getBirthDate();
		assertNull(result);
	}

	@Test
	@DisplayName("Verifies that getType returns the PetType object that was previously set")
	void testGetTypeReturnsSetValue() {
		Pet pet = new Pet();
		PetType petType = new PetType();
		petType.setName("Dog");
		pet.setType(petType);
		var result = pet.getType();
		assertNotNull(result);
		assertEquals(petType, result);
	}

	@Test
	@DisplayName("Verifies that getType returns null if no type has been set (initial state)")
	void testGetTypeReturnsNullWhenNotSet() {
		Pet pet = new Pet();
		var result = pet.getType();
		assertNull(result);
	}

	@Test
	@DisplayName("Verifies that getType returns null when setType is called with null")
	void testGetTypeReturnsNullWhenSetToNull() {
		Pet pet = new Pet();
		pet.setType(null);
		var result = pet.getType();
		assertNull(result);
	}

	@Test
	@DisplayName("Verifies that the setType method accepts a valid PetType object and updates the pet's type")
	void testSetTypeWithValidPetType() {
		instance.setType(new PetType());
	}

	@Test
	@DisplayName("Verifies that the setType method handles null input without throwing an exception")
	void testSetTypeWithNull() {
		instance.setType(null);
	}

	@Test
	@DisplayName("Verifies that calling setType multiple times updates the type each time")
	void testSetTypeAfterSettingType() {
		instance.setType(new PetType());
	}

	@Test
	@DisplayName("Verifies that getVisits returns an empty collection when no visits have been added")
	void testGetVisitsWhenNoVisitsExist() {
		var result = instance.getVisits();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getVisits returns a collection with all added visits in the order added")
	void testGetVisitsAfterAddingMultipleVisits() {
		var result = instance.getVisits();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that addVisit does not throw NullPointerException when passed a null visit")
	void testAddVisitWithNullVisit() {
		assertDoesNotThrow(() -> instance.addVisit(null));
	}

}
